export default (function(a,b,c,d,e,f,g,h,i){return {data:{hDnok7Iydp:{data:{id:1784,attributes:{imdbId:"tt0119468",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjE2MWE1ZDYtNjNkYS00YjZmLWJkZjctOTYzYTVjMDFiN2M5XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"33%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:2447,attributes:{title:a,plot:"Alex Cross, a Washington D.C. cop and forensic psychologist learns that his niece who is going to college in North Carolina is missing. So he goes there and learns that the police think she's among the victims of someone who kidnaps young girls and holds them captive and kills them who dubs himself Cassanova after the great lover. Later Kate, one of his victims, escapes and tries to help Cross find his niece.",slug:"kiss-the-girls"}}},books:{data:[{id:9134,attributes:{title:a,description:"The second novel in the bestselling Alex Cross seriesDetective Alex Cross is caught between two murderous masterminds - and so is his family...When his niece Naomi goes missing, Alex Cross follows the trail - and discovers links to a string of recent abductions and murders, with one horrifying complication.There are two killers at work on opposite sides of the country, collaborating and competing to commit the worst crimes the country has ever seen.With his family at risk, Cross knows that his investigation is putting him directly in the line of fire...Adapted as a major Hollywood movie, starring Morgan Freeman",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gPPCwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2017-06-15",publisher:"Arrow",subtitle:d}},{id:9135,attributes:{title:a,description:"In Los Angeles, a reporter investigating a series of murders is killed. In Chapel Hill, North Carolina, a beautiful medical intern suddenly disappears. Washington D.C.Us Alex Cross is back to solve the most baffling and terrifying murder case ever. Two clever pattern killers are collaborating, cooperating, competing--and they are working coast to coast.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zx9JuAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2012-01-01",publisher:"Grand Central Pub",subtitle:d}},{id:9136,attributes:{title:a,description:f,thumbnail:g,authors:[b],firstBook:c,published:h,publisher:e,subtitle:i}},{id:9137,attributes:{title:a,description:f,thumbnail:g,authors:[b],firstBook:c,published:h,publisher:e,subtitle:i}},{id:9138,attributes:{title:"Hide and Seek",description:"The world's favorite singer is on trial for murdering a glamorous athlete . . . but in a ruthless world of power and privilege, life and death aren't what they seem. It was the trial that electrified the world. Not just because of the defendant, Maggie Bradford, the woman whose songs captivated the world's heart. Not just because of the victim, Will Shepard, the world's most glamorous athlete. But also because everyone said Maggie had murdered not just one husband, but two. And because in Maggie's world -- the world she feared and despised but could not escape, the world of the powerful, the rich, and the ruthless -- both death and life could never be what they seemed. From James Patterson, bestselling author of the Alex Cross and Women's Murder Club series, comes a brilliantly realized thriller that will shatter your expectations . . . and hold every last one of your nerves in thrall with each twist of the plot and every turn of the page.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eAdmAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"1996-12-01",publisher:e,subtitle:d}}]}}},meta:{}}},prerenderedAt:1680940959151}}("Kiss the Girls","James Patterson",null,"","Hachette UK","Join Alex Cross on his most terrifying murder case yet in this #1 New York Times bestseller and one of PBS's \"100 Great American Reads.\" In Los Angeles, a reporter investigating a series of murders is killed. In Chapel Hill, North Carolina, a beautiful medical intern suddenly disappears. In the sequel to Along Came a Spider, Washington D.C.'s Alex Cross is back to solve the most baffling and terrifying murder case ever. Two clever pattern killers are collaborating, cooperating, competing-and they are working coast to coast.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lEWgCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2002-12-11","A Novel by the Author of the Bestselling Along Came a Spider"))